import React from 'react'
import styled from 'styled-components'
import { Header } from '../main-pages/header'
import { Margin36 } from '../component/styledComponent'
import { TermBox } from './termBox'
import { LocationText, PrivacyText } from './text'
import { Footer } from '../main-pages/footer'

const Container = styled.div`
  width: 100%;
`
const BodyContainer = styled.div`
  margin: 0 auto;
  width: 1280px;
`

const Title = styled.div`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 24px;
  line-height: 24px;
  color: #000000;
  text-align: left;
  margin-top: 56px;
`

export const Privacy = () => {
  return (
    <Container>
      <Header />
      <Margin36 />
      <BodyContainer>
        {PrivacyText.map(privacy => {
          return <TermBox title={privacy.title} contents={privacy.contents} />
        })}
        <div style={{ marginTop: '80px' }} />
      </BodyContainer>
      <Footer />
    </Container>
  )
}
